    public int numMatchingSubseq(String S, String[] words) {
        // 半完成，但是因為時間速度上不足，沒通過測試。邏輯是對的
        if (S.length() == 0) return 0;
        int[] indexList = new int[words.length];
        Map<String, String> map = new HashMap<>();
        int sum = 0;
        for (int i = 0; i < S.length(); i++) {
            for (int j = 0; j < words.length; j++) {
                if (indexList[j] < words[j].length()) {
                    if (map.containsKey(words[j])) {
                        sum++;
                        indexList[j]++;
                    } else {
                        if (S.charAt(i) == words[j].charAt(indexList[j]) &&
                                        ++indexList[j] == words[j].length()) {
                            sum++;
                            map.put(words[j], words[j]);
                        }
                    }
                }
            }
        }
        return sum;
    }

